import React from 'react';
import ReactDOM from 'react-dom';
import './style.css';
import TodoItems from './TodoItems.js'


function App() {
    return(
        <div class="">
            <TodoItems />
            <TodoItems />
            <TodoItems />
            <TodoItems />
        </div>
    );
}



ReactDOM.render(<App />, document.getElementById('root'));
